-- ----------------------------
-- Table structure for alert_event
-- ----------------------------
DROP TABLE IF EXISTS `alert_event`;
CREATE TABLE `alert_event`  (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `rule_id` bigint NULL DEFAULT NULL COMMENT '关联的规则 ID',
  `device_id` bigint NULL DEFAULT NULL COMMENT '触发报警的设备 ID',
  `metric_key` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '触发的指标',
  `current_value` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '当前值（如 36.5℃）',
  `alarm_content` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '报警内容（如 “温度 36.5℃，超出阈值 35℃”）',
  `level` tinyint NULL DEFAULT NULL COMMENT '报警级别（继承规则的 level）',
  `status` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT '0' COMMENT '事件状态（0 - 未处理，1 - 已处理，2 - 已忽略）',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `create_by` bigint NULL DEFAULT NULL COMMENT '创建人ID',
  `update_time` datetime NULL DEFAULT NULL COMMENT '更新时间',
  `update_by` bigint NULL DEFAULT NULL COMMENT '更新人ID',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 2397 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of alert_event
-- ----------------------------

-- ----------------------------
-- Table structure for alert_rule
-- ----------------------------
DROP TABLE IF EXISTS `alert_rule`;
CREATE TABLE `alert_rule`  (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `rule_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '规则名称',
  `device_id` bigint NULL DEFAULT NULL,
  `scene_id` bigint NULL DEFAULT NULL COMMENT '设备告警配置关绑定场景时',
  `time_range` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '时间范围',
  `level` tinyint NOT NULL COMMENT '报警级别（1 - 紧急，2 - 重要，3 - 一般，用于后续通知策略）',
  `min_value` bigint NULL DEFAULT NULL COMMENT '范围下限（当 compare_type 为 “range” 时生效，如 min=10，max=30 表示超出 [10,30] 报警）',
  `max_value` bigint NULL DEFAULT NULL COMMENT '范围上限（同上）',
  `metric_key` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '对应设备传入属性',
  `compare_type` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '比较类型（>、<、>=、<=、==、!=，或 “range” 表示范围）',
  `threshold_value` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '阈值（如 35，表示 “temperature>35” 报警）',
  `time_window` int NULL DEFAULT NULL COMMENT '时间窗口（秒，如 60，表示 “1 分钟内连续 3 次超阈值” 报警）',
  `consecutive_count` int NULL DEFAULT NULL COMMENT '连续次数（如 3，配合 time_window 使用）',
  `remark` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '备注信息',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `create_by` bigint NULL DEFAULT NULL COMMENT '创建人ID',
  `update_time` datetime NULL DEFAULT NULL COMMENT '更新时间',
  `update_by` bigint NULL DEFAULT NULL COMMENT '更新人ID',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 34 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci ROW_FORMAT = Dynamic;

